import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Containers/Header';
import ProductListing from './Containers/ProductListing';
import ProductDetails from './Containers/ProductDetails';

function App() {
  return (
    <>
    <BrowserRouter>
    <Header />

    <Routes>
      <Route to ='/' exact Component={ProductListing} />
      <Route to ='/product/:productId' exact Component={ProductDetails} />
      <Route></Route>
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
